import React, { useState, useEffect } from 'react';
import bookmarkService from './bookmarkService';
import QuestionAndCodeBlock from './QuestionAndCodeBlock'; // Import the component to reuse

const UserDashboard = () => {
  const [bookmarkedQuestions, setBookmarkedQuestions] = useState([]);

  useEffect(() => {
    const fetchBookmarkedQuestions = async () => {
      try {
        const token = localStorage.getItem('token');
        const response = await bookmarkService.getBookmarks(token);

        if (response.success) {
          setBookmarkedQuestions(response.data);
        } else {
          console.error('Error fetching bookmarked questions:', response.message);
        }
      } catch (error) {
        console.error('Error fetching bookmarked questions:', error);
      }
    };

    fetchBookmarkedQuestions();
  }, []);

  return (
    <div className="questions-list">
      <h1>Your Bookmarked Questions</h1>
      {bookmarkedQuestions.length > 0 ? (
        bookmarkedQuestions.map((question) => (
          <div key={question.id}>
            <h2>{question.questionText}</h2>
            <QuestionAndCodeBlock questionId={question.id} code={question.codeSnippet} />
          </div>
        ))
      ) : (
        <p>No bookmarked questions found.</p>
      )}
    </div>
  );
};

export default UserDashboard;
